script: |
  super -f text -I q1625.spq | sort > q1625.out

inputs:
  - name: q1625.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE 48 + 39 + + col0 NOT BETWEEN 98 / + 82 + + ( + col0 ) * + 46 AND 51;
  - name: tab1

outputs:
  - name: q1625.out
    data: |
      51	14	96
      85	5	59
      91	47	68
